import React from "react";
import { useCart } from "../../context/CartContext";

export default function MyCart() {
  const { cart, removeFromCart, clearCart } = useCart();

  const subtotal = cart.reduce(
    (sum, item) => sum + item.price * item.quantity,
    0
  );

  return (
    <div className="cart-wrapper">
      <h2 className="cart-title">üõí My Cart</h2>

      {cart.length === 0 ? (
        <div className="empty-cart">
          <p>Your cart is empty</p>
          <span>üõçÔ∏è</span>
        </div>
      ) : (
        <>
          {cart.map((item) => (
            <div key={`${item.id}-${item.size}`} className="product-wrapper">

              {/* IMAGE CARD (LEFT) */}
              <div className="image-card">
                <div className="image-container">
                  <img
                    src={item.image}
                    alt={item.name}
                    className="product-image"
                  />
                </div>
              </div>

              {/* DETAILS (RIGHT) */}
              <div className="product-details">
                <h2 className="product-name">{item.name}</h2>

                {item.description && (
                  <p className="description-text">{item.description}</p>
                )}

                <p className="price">‚Çπ{item.price}</p>

                <p className="meta">
                  Size: <b>{item.size}</b>
                </p>

                <p className="meta">
                  Quantity: <b>{item.quantity}</b>
                </p>

                <p className="total">
                  Total: ‚Çπ{item.price * item.quantity}
                </p>

                <button
                  className="btn danger"
                  onClick={() => removeFromCart(item.id)}
                >
                  Remove
                </button>
              </div>
            </div>
          ))}

          {/* ORDER SUMMARY */}
          <div className="summary-card">
            <h3>Order Summary</h3>
            <p>
              Subtotal <span>‚Çπ{subtotal}</span>
            </p>
            <p>
              Shipping <span>Free</span>
            </p>
            <hr />
            <p className="grand-total">
              Total <span>‚Çπ{subtotal}</span>
            </p>

            <button className="btn primary">Proceed to Checkout</button>
            <button className="btn clear" onClick={clearCart}>
              Clear Cart
            </button>
          </div>
        </>
      )}

      {/* STYLES */}
      <style>{`
        .cart-wrapper {
          max-width: 1100px;
          margin: 40px auto;
          padding: 20px;
        }

        .cart-title {
          font-size: 26px;
          margin-bottom: 30px;
        }

        .empty-cart {
          text-align: center;
          padding: 80px;
          border: 1px solid #eee;
          border-radius: 16px;
          font-size: 18px;
        }

        .empty-cart span {
          font-size: 48px;
        }

        .product-wrapper {
          display: flex;
          gap: 32px;
          margin-bottom: 30px;
          padding: 20px;
          border-radius: 18px;
          background: #fff;
          box-shadow: 0 10px 25px rgba(0,0,0,0.08);
        }

        .image-card {
          width: 300px;
          padding: 14px;
          border-radius: 18px;
          background: #fff;
          box-shadow: 0 8px 20px rgba(0,0,0,0.12);
        }

        .image-container {
          height: 380px;
          border-radius: 14px;
          overflow: hidden;
        }

        .product-image {
          width: 100%;
          height: 100%;
          object-fit: cover;
        }

        .product-details {
          flex: 1;
        }

        .product-name {
          font-size: 24px;
          margin-bottom: 10px;
        }

        .description-text {
          color: #555;
          margin-bottom: 12px;
        }

        .price {
          font-size: 22px;
          font-weight: 600;
          margin-bottom: 10px;
        }

        .meta {
          margin-bottom: 6px;
          color: #666;
        }

        .total {
          font-size: 18px;
          font-weight: 600;
          margin: 16px 0;
        }

        .summary-card {
          margin-top: 40px;
          padding: 24px;
          border-radius: 18px;
          background: #fff;
          box-shadow: 0 10px 25px rgba(0,0,0,0.1);
          max-width: 420px;
        }

        .summary-card p {
          display: flex;
          justify-content: space-between;
          margin-bottom: 10px;
        }

        .grand-total {
          font-size: 20px;
          font-weight: 600;
        }

        .btn {
          width: 100%;
          padding: 14px;
          border-radius: 12px;
          font-size: 16px;
          margin-top: 12px;
          cursor: pointer;
          border: none;
        }

        .primary {
          background: #000;
          color: #fff;
        }

        .danger {
          background: #ffeded;
          color: #c00;
        }

        .clear {
          background: none;
          color: #666;
        }

        @media (max-width: 768px) {
          .product-wrapper {
            flex-direction: column;
          }

          .image-card {
            width: 100%;
          }
        }
      `}</style>
    </div>
  );
}
